count = GPS_INFO["perPages"]
gps_info_list = GPS_INFO["currentElements"]

last_la = 0
last_lo = 0
last_time = 0

bad_count = 0
for index in range(len(gps_info_list)):
    # 设备ID
    device_id = gps_info_list[index]["deviceId"]
    # 定位时间
    gps_time = gps_info_list[index]["time"]
    # 纬度
    gps_latitude = gps_info_list[index]["latitude"]
    # 经度
    gps_longitude = gps_info_list[index]["longitude"]
    # 速度
    gps_speed = gps_info_list[index]["speed"]
    # 方向
    gps_direction = gps_info_list[index]["direction"]

    if last_la == 0 and last_lo == 0:
        # 说明是第一个点，自己与自己计算
        distance = haversine(gps_longitude, gps_latitude, gps_longitude, gps_latitude)
        time_interval = gps_time - gps_time
    else:
        distance = haversine(last_lo, last_la, gps_longitude, gps_latitude)
        time_interval = gps_time - last_time

    last_lo = gps_longitude
    last_la = gps_latitude
    last_time = gps_time

    # 时间做一下转换
    # 转换成localtime
    time_local = time.localtime(gps_time / 1000)
    # 转换成新的时间格式(2016-05-05 20:28:54)
    dt = time.strftime("%Y-%m-%d %H:%M:%S", time_local)

    # 算一下真实的速度
    if distance > 0:
        real_speed = (float(distance) / (float(time_interval) / 1000.00))
    else:
        real_speed = 0

    # 民用GPS经度为15米左右，信号不好时能达到20-30米
    # 位移速度超过33米/秒的，即位移时速超过了137公里/小时，我们也认定为无效点
    if distance < 15 or real_speed > 38:
        result = "DeviceID:%s Time:%s TimeInter:%d La:%f Lo:%f Speed:%f(m/s) Direction:%d Distance:%f(m)" % (device_id, dt, time_interval / 1000, gps_latitude, gps_longitude, real_speed, gps_direction, distance)
        print(result)
        bad_count = bad_count + 1

print("总点数:" + str(len(gps_info_list)) + " 不符合政策的GPS点个数:" + str(bad_count) + " 不符合政策GPS点数占比:" + str((float(bad_count) / float(len(gps_info_list))) * 100) + "%")



